import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';


import ListServers from './components/ListServers'; // Updated import path
import AddServer from './components/AddServer'; // Updated import path
import DeleteServer from './components/DeleteServer'; // Updated import path

function App() {
  return (
    <Router>
      <div className="App">
        {/* No Navigation component */}
        <Switch>
          <Route path="/" exact component={ListServers} />
          <Route path="/add" component={AddServer} />
          <Route path="/delete/:id" component={DeleteServer} />
          {/* Add more routes as needed */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
